import React from 'react';
import { TextStyle } from '@shopify/polaris';

const Index = () => (
  <div>
    <p>Sample app using React and Next.js</p>
    <TextStyle variation="positive">Sample app using React and Next.js</TextStyle>
  </div>
);

export default Index;
